import { Component,OnInit,Inject } from '@angular/core';
import {MatDialogRef,MAT_DIALOG_DATA} from '@angular/material/dialog';
import { Branch } from 'src/app/Interfaces/branch';

@Component({
  selector: 'app-dialog-delete',
  templateUrl: './dialog-delete.component.html',
  styleUrls: ['./dialog-delete.component.css']
})
export class DialogDeleteComponent {

  constructor(
    private dialogReference:MatDialogRef<DialogDeleteComponent>,
    @Inject(MAT_DIALOG_DATA) public dataBranch:Branch
  ){}

  ngOnInit():void{}

  confirmDelete(){
    if(this.dataBranch){
      this.dialogReference.close("eliminado");
    }
  }
}
<h1 mat-dialog-title>Eliminar Sucursal</h1>
<div mat-dialog-content>¿Desea eliminar la Sucursal "{{dataBranch.BranchDescription}}"?
</div>
<div mat-dialog-actions>
  <button mat-raised-button mat-dialog-close color="warm">No,Volver</button>
  <button mat-raised-button color="primary" (click)="confirmDelete()" cdkFocusInitial>Eliminar</button>
</div>
